  [],\n\t\"revision_timestamp\": \"2016-11-18T20:00:42.012620\",\n\t\"name\": \"survival-and-recovery-rates-of-mallards-banded-postseason-in-south-carolina\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a published report on the survival
  and recovery rates of mallards after they have been banded in South Carolina. The
  mallard (Anas platyrhynchos) has received much attention from population ecologists
  due to its abundance and popularity as a game species. Analyses of banding data
  (Hickey 1952, Anderson1975, Hopper et al. 1975) have demonstrated differences in
  survival and recovery rates between immature and adult mallards banded before the
  hunting season. Hopper et al. (1978) examined theserates for adult and immature
  mallards banded postseason in Colorado. I assessed the influence of age and sex
  on these rates for 1967-77 using the largest single data set available for mallards
  banded postseason (1 Jan-28 Feb) in the Atlantic Flyway.\",\n\t\"license_title\":
